import React from "react";
import styled from "styled-components";
import Link from "next/link";

const MyHeader = styled.nav`
  display: grid;
  grid-template-columns: 4fr 1fr 1fr;
`;

const Header = props => {
  return (
    <MyHeader>
      <h3>Corona Virus Stats - {Date.now()}</h3>
    </MyHeader>
  );
};

export default Header;
